import Button from "../../atoms/button/button";

const search = (props) => {
  return (
    <div className="search">
    <ul>
        {props.data.navBar.search.map((item, index) => {
            return <li> {item}</li>;
        })}

    </ul>
</div>
  );
};

export default search;
